import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Profile from "./Profile"

class User extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            userInfo: {}
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/user/profile/', {
            method: "GET",
            mode: "cors",
            cache: 'default',
            headers: {
                "x-originals-token": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyX2lkIjoxLCJlbWFpbCI6InN0ZXZ6aGFuZzAxQGdtYWlsLmNvbSIsIm1vYmlsZSI6IjEzOTE5MTU0OTI1Iiwibmlja19uYW1lIjoiU3RldkUuWiIsImltYWdlX3VybCI6IiIsImV4cCI6MTU1NzU1NzU1OCwiaWF0IjoxNTU3NTU3MjU4fQ.t9jOlh12IsKnEn5JQaiheCttEfbR1yuj12lsm-C8-HU"
            }
        }).then(rst => {
            console.log(rst.json())
        }).catch(err => {
            console.log(err)
        })
    }

    render() {
        return (
            <div>
                <Router>
                    <div>
                        <Route path="/user/:userId" component={Profile}/>
                    </div>
                </Router>
            </div>
        );
    }
}

export default User;
